# yaml-language-server: $schema=https://raw.githubusercontent.com/fern-api/fern/main/fern.schema.json

imports:
  globalApiTypes: ./../global-api-types.yml
  posApiTypes: ./../pos/pos-api-types.yml
#
types:  
  SalesInvoiceBase64:
    properties:
      value: base64
    examples:
      - name: ExampleSalesInvoiceBase64
        value:
          value: ""
  
############################################ 

service:
  auth: true
  base-path: /sale
  endpoints:
    getSalesInvoiceAsPDF:
      display-name: Get Sales Invoice as PDF
      method: GET
      path: /invoice/{documentNo}/PDF
      availability: 
        status: pre-release
      request:
        name: getSalesInvoiceAsPDF
        path-parameters:
          documentNo: string
      response:
        type: SalesInvoiceBase64
      examples:
        - name: Example Sales Invoice as PDF (Base 64 encoded string)
          path-parameters:
            tenant: $globalApiTypes.tenant.Exampletenant
            environment: $globalApiTypes.environment.ExampleenvironmentProduction
            company: $globalApiTypes.Company.ExampleCompanyCronus
            documentNo: "103027"
          response:
            body: $SalesInvoiceBase64.ExampleSalesInvoiceBase64

